import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import TableCell   from '@material-ui/core/TableCell';
import CanvasGraph from './CanvasGraphComponent';

//	textAlign: "center",
const styles = theme => ({
    pointer: {
	textAlign: "center",
	cursor:"pointer",
	padding: 0,
	overflow: 'hidden',
	tableLayout: 'fixed',
    },
    nopointer: {
	textAlign: "center",
	padding: 0,
	overflow: 'hidden',
	tableLayout: 'fixed',
    },
    div: {
	overflow: 'hidden',
	tableLayout: 'fixed',
    },
    divTableCell:{
	border: '0px solid #999999',
	display: 'table-cell',
	padding: '0px 0px',
    },
    divTableCellCursor:{
	cursor: "pointer",
	border: '0px solid #999999',
	display: 'table-cell',
	padding: '0px 0px',
    },
});
//	padding: "0px";
//	textAlign: "center",
function SeriesCell(props) {
    const { classes,state,onclick,
	    colwhere,rowwhere,
	    elements,plan,key,...other } = props;
    var cnt=0;
    var lev=-1;
    var elen=elements.length;
    for (var ee=0;ee<elen;ee++) {
        cnt=cnt+elements[ee].cnt;
        lev=Math.max(lev,elements[ee].lev);
    }; 
    var label="";
    if (cnt > 1) {label=cnt;};
    var bgcolor=state.Colors.getLevelColor(lev);
    var cursor=classes.nopointer;
    if (onclick !== undefined) {
	cursor=classes.pointer;
    }
    var title="";
    if (colwhere !== "" && rowwhere !== "") {
	title="("+colwhere+") AND ("+rowwhere+")";
    } else if (colwhere !== "") {
	title=colwhere;
    } else if (rowwhere !== "") {
	title=rowwhere;
    }
    // var bgcolor=state.Colors.getLevelColor(lev);
    // bgcolor={bgcolor} 
    // height={plan.cell}
    // width={plan.width}
    console.log("SeriesCell:",JSON.stringify(elements));
    return(
	    <div className={(onclick !== undefined?classes.divTableCellCursor:classes.divTableCell)} style={{backgroundColor:bgcolor}} onClick={onclick} title={title} key={key} height={plan.cell} width={plan.width}>
  	    <CanvasGraph {...other} state={state}
	          onclick={onclick} title={title} elements={elements} level={lev} plan={plan}/>  
	     </div>
    );
}



SeriesCell.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SeriesCell);
